import React from 'react'
import './ContactPage.css'

function ContactPage() {
  return (
    <div className="contact-container">
      <h2>Contact Me</h2>
      <p>You can contact me via email or phone number:</p>
      <h3>Email: erolerutik9@gmail.com</h3>
      <h3>Phone: 8652677526</h3>
    </div>
  );
}

export default ContactPage;
